// HospitalMembers.js
import React, { useEffect, useState, useContext } from 'react';
import { AuthContext } from '../AuthContext'; // AuthContext에서 authFetch 함수 가져오기
import API_BASE_URL from '../Config'; // API 기본 URL 가져오기
import './HospitalMembers.css'; // 스타일 파일

const HospitalMembers = () => {
  const { authFetch } = useContext(AuthContext);
  const [members, setMembers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [page, setPage] = useState(0);
  const [totalPages, setTotalPages] = useState(1);
  const [sortBy, setSortBy] = useState('name');
  const [sortOrder, setSortOrder] = useState('ASC');

  // 병원 멤버 데이터 가져오기
  const fetchMembers = async () => {
    setLoading(true);
    try {
      const response = await authFetch(
        `${API_BASE_URL}/doctor/hospital/33/member?page=${page}&size=5&sort=${sortBy},${sortOrder}`,
        {
          method: 'GET',
        }
      );
      if (response.status === 200) {
        setMembers(response.data.content || []);
        setTotalPages(response.data.totalPages || 1);
      } else {
        console.error('멤버 정보를 가져오는데 실패했습니다:', response);
      }
    } catch (error) {
      console.error('멤버 정보를 가져오는 중 오류 발생:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchMembers();
  }, [page, sortBy, sortOrder]);

  const handleSortChange = (event) => {
    setSortBy(event.target.value);
  };

  const handleSortOrderChange = () => {
    setSortOrder((prevOrder) => (prevOrder === 'ASC' ? 'DESC' : 'ASC'));
  };

  const handleNextPage = () => {
    if (page < totalPages - 1) setPage(page + 1);
  };

  const handlePreviousPage = () => {
    if (page > 0) setPage(page - 1);
  };

  if (loading) {
    return <p>로딩 중...</p>;
  }

  return (
    <div className="hospital-members">
      <h1>병원 멤버 관리하기</h1>
      <div className="controls">
        <div className="sort-controls">
          <label>정렬 기준: </label>
          <select value={sortBy} onChange={handleSortChange}>
            <option value="name">이름</option>
            <option value="joinedAt">등록 일자</option>
          </select>
          <button onClick={handleSortOrderChange}>
            {sortOrder === 'ASC' ? '오름차순 ▲' : '내림차순 ▼'}
          </button>
        </div>
      </div>
      <table className="members-table">
        <thead>
          <tr>
            <th>이름</th>
            <th>연락처</th>
            <th>전공 분야</th>
            <th>승인 책임자</th>
            <th>등록 일자</th>
          </tr>
        </thead>
        <tbody>
          {members.map((member) => (
            <tr key={member.id.number}>
              <td>{member.name}</td>
              <td>{member.phone}</td>
              <td>{member.specialty}</td>
              <td>{member.professionalSummary}</td>
              <td>{new Date(member.joinedAt).toLocaleDateString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="pagination">
        <button disabled={page === 0} onClick={handlePreviousPage}>
          이전
        </button>
        <span>
          페이지 {page + 1} / {totalPages}
        </span>
        <button disabled={page === totalPages - 1} onClick={handleNextPage}>
          다음
        </button>
      </div>
    </div>
  );
};

export default HospitalMembers;
